xAxis.func:
__ht__function(data, view) {
return [
    {
        "axisLabel": {
            "color": data.ca('axisLabel.color')
        },
        "axisTick": {
            "show": data.ca('axisTick.show'),
            "color": data.ca('axisLine.color')
        },
        "axisLine": {
            "show": true,
            "color": data.ca('axisLine.color')
        },
        "splitLine": {
            "show": data.ca('splitLineX.show'),
            "color": data.ca('splitLine.color')
        },
        "data": data.ca('xAxis.data')
    }
]
}

yAxis.func:
__ht__function(data, view) {
let param = {
    "axisLabel": {
        "color": data.ca('axisLabel.color')
    },
    "axisLine": {
        "color": data.ca('axisLine.color')
    },
    "axisTick": {
        "show": data.ca('axisTick.show'),
        "color": data.ca('axisLine.color')
    },
    "splitLine": {
        "show": data.ca('splitLineY.show'),
        "color": data.ca('splitLine.color')
    },
    "markLines": [
        {
            "value": data.ca('markValues') ? (data.ca('markValues')[0] ? data.ca('markValues')[0] : 0) : 0,
            "color": data.ca('markColors') ? (data.ca('markColors')[0] ? data.ca('markColors')[0] : undefined) : undefined,
        },
        {
            "value": data.ca('markValues') ? (data.ca('markValues')[1] ? data.ca('markValues')[1] : 0) : 0,
            "color": data.ca('markColors') ? (data.ca('markColors')[1] ? data.ca('markColors')[1] : undefined) : undefined,
        },
    ]
}
if(data.ca('markValues') == undefined || data.ca('markValues').length == 0) delete param.markLines;
return param;
}
